import ExpenseItem from './ExpenseItem'

function Expenses (props) {
  return (
    <div>
      <ExpenseItem
        title={props[0].items.title}
        amount={props[0].items.amount}
        date={props[0].items.date}
      />
      <ExpenseItem
        title={props[1].items.title}
        amount={props[1].items.amount}
        date={props[1].items.date}
      />
      <ExpenseItem
        title={props[2].items.title}
        amount={props[2].items.amount}
        date={props[2].items.date}
      />
      <ExpenseItem
        title={props[3].items.title}
        amount={props[3].items.amount}
        date={props[3].items.date}
      />
    </div>
  );
}

export default Expenses;
